import React from "react";

import {APIProvider, Map} from '@vis.gl/react-google-maps'


export const Google_Map = () => {

    window.navigator.geolocation.getCurrentPosition((position)=>{
        let Current_Lat = position.coords.latitude
        let Current_Lng = position.coords.longitude
        console.log(Current_Lat,Current_Lng)
    })

return <React.Fragment>

            <APIProvider apiKey={`${process.env.REACT_APP_API}`}>

                <Map
                
                    style={ 
                        { width:'inherit',
                        height:'20vh',
                        backgroundColor:'white',
                        margin: '3vh 6vw 0 10vw',
                        border: 'black solid 5px'
                        }}
                    
                    zoom={15}

                    center={{lat: 53.54992, lng: 10.00678}} />

            </APIProvider>


</React.Fragment>

}

export default Google_Map
